entry.value:
// Read the input flow file and parse it as a JSON object
//var inputJSON = JSON.parse(input.toString('utf-8'));
var inputJSON = JSON.parse(inputStream.toString('utf-8'));
// Create an output object with the same keys as the desired format, but with the values from the input object
var output = {
  userId: inputJSON.USERID,
  sessionId: inputJSON.SESSIONID,
  startTimestamp: inputJSON.STARTTIMESTAMP,
  endTimestamp: inputJSON.ENDTIMESTAMP || '',
  action: inputJSON.ACTION,
  transactionId: inputJSON.TRANSACTIONID,
  loanReferenceId: inputJSON.LOANREFERENCEID
};

// Convert the output object to a JSON string
var outputJSONStr = JSON.stringify(output);

// Write the output JSON string to the output flow file
output = outputJSONStr;
